import React, { useState } from 'react';
import UserResearchNetwork from './components/UserResearchNetwork';
import './App.css';

function App() {
  // You can provide initial data here if needed
  const [initialData] = useState(null);

  return (
    <div className="App">
      <header className="App-header">
        <h1>User Feedback Visualization</h1>
      </header>
      <main>
        <UserResearchNetwork initialData={initialData} />
      </main>
    </div>
  );
}

export default App;
